import React, { useState, useEffect } from "react";
import axios from "axios";
import {useParams, Link } from "react-router-dom";


const DetailUser = () => {
  const [users, setUser] = useState([]);
  const {id} = useParams();

  useEffect(() => {
    getUserById();
  }, []);

  const getUserById = async () => {
    const response = await axios.get(`http://localhost:5000/users/${id}`);
    setUser(response.data);
  };
  const [pelanggarans, setPelanggaran] = useState([]);

  useEffect(() => {
    getPelanggarans();
  }, []);

  const getPelanggarans = async () => {
    const response = await axios.get("http://localhost:5000/pelanggarans");
    setPelanggaran(response.data);
  };
  return (
    <div
      className="box"
      style={{
        width: "50%",
        margin: "0 auto",
        marginTop: "50px",
        paddingBottom: "70px",
      }}
    >
    <div><h1 style={{ textAlign:"center",fontSize:"2rem",marginBottom:"30px" }}>Detail Informasi Pelanggaran</h1></div>
      <div class="columns">
        <div class="column is-1">Nama : </div>
        <div class="column">{users.name}</div>
      </div>
      <div class="columns">
        <div class="column is-1">Email : </div>
        <div class="column">{users.email}</div>
      </div>
      <div class="columns">
        <div class="column is-1">Point : </div>
        <div class="column">{users.point}</div>
      </div>
      <div className="container mt-5">
      <div className="columns is-centered">
        <div className="column is-four-fifths">
          <Link to={"add/pelanggaran"} className="button is-primary is-rounded">
            Tambah
          </Link>
          <div className="table-container">
            <table className="table is-fullwidth is-striped is-hoverable is-responsive">
              <thead>
                <tr>
                  <th>No</th>
                  <th>Tanggal</th>
                  <th>Pelanggaran</th>
                  <th>Penguragan Point</th>
                  <th>Action</th>
                </tr>
              </thead>
              <tbody>
                {pelanggarans.map((pelanggaran, index) => (
                  <tr key={pelanggaran._id}>
                    <td>{index + 1}</td>
                    <td>{pelanggaran.date}</td>
                    <td>{pelanggaran.keterangan}</td>
                    <td>{pelanggaran.point}</td>
                    <td>
                      <Link to={`edit/${pelanggaran._id}`} className="button is-warning is-rounded">
                        Edit
                      </Link>
                      <button className="button is-danger is-rounded">
                        Delete
                      </button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </div>
    </div>
    
  );
};

export default DetailUser;
